import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';

import { IonicModule } from '@ionic/angular';

import { DocumentmedecinPageRoutingModule } from './documentmedecin-routing.module';

import { DocumentmedecinPage } from './documentmedecin.page';

@NgModule({
  imports: [
    CommonModule,
    FormsModule,
    IonicModule,
    DocumentmedecinPageRoutingModule
  ],
  declarations: [DocumentmedecinPage]
})
export class DocumentmedecinPageModule {}
